import React, {Component} from 'react';
import Navbar from '../Navbar/Navbar';
import "./Header.css"


class Header extends Component{
    constructor (props) {
        super(props)
        this.state = ""
    }

    function(){
        return (
            <header>

                <nav className='nav'>
                    <Navbar/> 
                </nav>
            </header>
        )
    }
}

export default Header
